const Render = () => {

    return (
        <div>
            <div className='flex flex-col text-lg p-8 min-h-screen'>
            <Link to="/" className='cursor-pointer mb-4 underline text-blue-600 hover:text-blue-800 visited:text-purple-600'>back to the homepage</Link>
                <div className='text-4xl font-bold leading-normal mb-4'>halfway there!</div>
                <div className='mb-4'>sda</div>
                <div className='mb-4'>sda</div>
                <div className='mb-4'>dsa</div>
                <Link to="/apply" className='cursor-pointer bg-black text-white text-center rounded-lg my-5 w-max p-2.5 px-5 mb-10'>!</Link>
            </div>
        </div>
    )
}

export default Render
